import React from 'react'
import NoteButton from './NoteButton';

const NoteButtonGroup = () => {
  return (
    <div>
        <NoteButton pageType={'saved'} />
        <NoteButton pageType={'saved'} />
        <NoteButton pageType={'saved'} />
        <NoteButton pageType={'saved'} />
        <NoteButton pageType={'saved'} />
    </div>
  )
}

export default NoteButtonGroup
